INSERT INTO `t_cmm_mcc` VALUES ('0742', '兽医服务', '维修及其他专业服务', '居民服务与商业服务', '主要指对各种动物进行的病情诊断和医疗活动。包括：畜牧兽医院（站、中心）、动物病防治单位、兽医监察等活动，宠物医院（诊所）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('0763', '农业合作 ', '商业服务', '居民服务与商业服务', '主要从事农场管理或农业生产，提供农业服务的商户，包括作物种植、病虫害防治、农业资料销售和种子销售等。农产品仓储服务，应列入4225（公共仓储服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('0780', '景观美化及园艺服务 ', '商业服务 ', '居民服务与商业服务 ', '主要提供城市园林绿化规划设计及其他园艺作物的种植和管理服务的商户。包括：城市草坪建设和管理，城市树木（古树、名树）管理，城市街心花园、街旁公园、广场草坪的管理，居民小区绿地、单位附属绿地、防护绿地、生产绿地和风景林地的建设和管理，城市绿地植物（树木、草坪、花卉）的养护及病虫害防止，城市树木、草坪病虫防治，盆栽观赏花木、工艺盆景等，用于装饰等目的的植物的种植，如草皮（草皮卷）等的种植等', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('1520', '一般承包商－住宅与商业楼', '房地产业 ', '房地产与金融业', '主要指基础设施建设、房屋建设，以及房地产开发项目转让或者销售、出租商品房等的房地产开发企业。包括：土地使用权的转让、买卖和租赁活动；住宅、公寓的开发、销售、出租等活动；办公楼的开发、销售、出租等活动；商业营业用房的开发、销售、出租等活动；其他建筑物的开发、销售、出租等活动。不包括：房屋及其他建筑物的工程施工活动；露营地的服务，列入7032（运动和娱乐露营地）。', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4011', '铁路运输 ', '交通运输、物流和仓储服务', '居民服务与商业服务', '主要提供货运服务的铁路商户。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4111', '本市和市郊通勤旅客运输（包括轮渡）', '交通运输、物流和仓储服务', '居民服务与商业服务 ', '包括：市内公交汽车客运，城市近郊公交汽车客运，市内、市郊旅游观光客运；地铁交通，轻轨交通，有轨电车交通；各种索道、缆车的经营管理活动；城市轮渡。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4112', '铁路客运 ', '交通运输、物流和仓储服务', '居民服务与商业服务', '主要提供铁路旅客运输服务的机构。包括：铁路客运公司的运输活动。不包括：火车站内独立的餐饮和零售服务，列入餐饮业、零售业的相关行业类别中。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4119', '救护车服务', '交通运输、物流和仓储服务', '居民服务与商业服务', '主要提供有专业医护人员陪同的，紧急病人运输服务的商户。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4121', '出租车服务', '交通运输、物流和仓储服务', '居民服务与商业服务 ', '主要指司机驾驶出租车提供的客运服务。包括：按计程服务的轿车、客车等的出租车客运；按包车服务的轿车、客车等的出', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4131', '公路客运 ', '交通运输、物流和仓储服务', '居民服务与商业服务', '主要提供城市以外道路旅客运输服务的商户。包括：城市间的旅客长途、短途汽车运输；城市与乡镇间的旅客长途、短途汽车运输；乡镇间的旅客长途、短途汽车运输；旅客非汽车运输（摩托车、人力、畜力车等）。不包括：旅游班车，列入4722（旅行社和旅游服务）。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4214', '货物搬运和托运？当地和长途，移动和存储公司，以及当地递送服务 ', '交通运输、物流和仓储服务', '居民服务与商业服务 ', '主要提供本地或长途拖运服务的商户（物流公司），这些商户也可能提供存储服务。只提供居家货栈和存储，而没有拖运服务的，列入4225（公共仓储服务）。行包快递服务，列入4215（快递服务-航空、地面运输及水运）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4215', '快递服务（空运、地面运输或海运） ', '交通运输、物流和仓储服务', '居民服务与商业服务', '主要指国家邮政局系统以外的单位提供包裹、小件物品的收集、运输、发送服务，以及为顾客提供快速、便捷、灵活的商务快送服务。包括：非国家邮政的快递服务；非国家邮政的各种小件物品、包裹的寄递服务；非国家邮政的报刊寄递服务；各种商务快送活动；各种宅急送服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4225', '公共仓储服务－农产品、冷冻品和家用产品 ', '交通运输、物流和仓储服务', '居民服务与商业服务', '主要提供农产品、易变质商品、家用品的储藏的商户。提供本地短暂储藏和托运服务的商户，应列入4214（货物搬运及托运）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4411', '轮船及巡游航线服务', '交通运输、物流和仓储服务', '居民服务与商业服务', '主要提供在公海和内陆水道以渡假和休闲为目的的旅客运输的商户。其提供的食物、娱乐和住宿作为费用的一部分。提供本地摆渡服务的，应列入4111（本地和郊区通勤乘客运输，包括摆渡）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4457', '出租船只 ', '出租和租赁服务', '居民服务与商业服务', '主要提供游艇租赁服务的商户，如钓鱼船、家用游艇、帆船和快艇等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4458', '烟草配送', '批发类', '批发类', '从事向零售商（或批发商）进行烟草类商品配送并结算货款，并且获得国家特许经营的烟草公司（集团）以及该类公司（集团）下属的烟草配送中心，定义为烟草配送商户。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4468', '船舶、海运服务提供商 ', '出租和租赁服务', '居民服务与商业服务', '主要经营码头、出租或停泊船只，并提供其他相关服务，包括，船只清洁、船只修理，以及其他相关产品零售。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4511', '航空公司 ', '交通运输、物流和仓储服务', '居民服务与商业服务 ', '主要提供以旅客运输为主的航空运输企业。包括：专营旅客航空运输的活动；客货同机的以客运为主的航空运输活动。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4582', '机场服务', '交通运输、物流和仓储服务', '居民服务与商业服务', '主要指各类飞机场，各类飞机清洗、保养和维修服务，机场停机服务等。不包括：机场内各类食品、报纸、礼品、纪念品经销商。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4722', '旅行社 ', '商业服务 ', '居民服务与商业服务 ', '主要提供商务、组团和散客旅游的服务的商户。包括向顾客提供咨询、旅游计划和建议、日程安排、食宿和交通等服务，还包括导游活动。包括：国际、国内旅行社服务，导游服务。不包括：单纯的飞机、火车等旅客票务代理服务，列入4511（航空运输票务服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4733', '大型景区售票', '商业服务 ', '居民服务与商业服务 ', '大型景区是指经国家旅游局认定、质量等级在A级（含）以上的旅游景区，该类商户销售门票时可认定为“大型景区售票商户”。大型景区售票商户不包括以下商户：A 经营场所设在景区内或周边但不从事门票销售的商户，包括但不限于经营餐饮、住宿、娱乐、服饰或小商品等商户，应按照经营内容使用相应的MCC，不得使用景区售票MCC。B 不属于国家旅游局认定的A级以上旅游景区，应列入旅游与展览商户（MCC为“7993”）。C 渡假村、避暑山庄、疗养院等应列入住宿服务商户（MCC为“7011”）。D 游乐园、马戏团、嘉年华、占卜等应列入7996，水族馆、海洋馆和海豚馆应列入7998，电影院应列入7832，会员俱乐部等应列入7997。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4784', '路桥通行费 ', '交通运输、物流和仓储服务', '居民服务与商业服务', '收取路桥费的商户。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4789', '未列入其他代码的运输服务', '交通运输、物流和仓储服务', '居民服务与商业服务', '主要指其他乘客运输服务。如多方式联合运输，马车出租和运输、空中索道、航空往返运输服务及缆车。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4812', '电信设备和销售（商）', '家用电器及电子产品专门零售 ', '居民服务与商业服务', '主要经营电信设备的销售商店，如电话、传真机、寻呼机、手机和通讯相关器材。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4814', '电信服务， 包括本地和长途电话、信用卡电话、磁卡电话和传真 ', '信息与计算机服务 ', '居民服务与商业服务 ', '主要提供电信服务的商户，包括本地、长途电话、固定电话、移动电话业务处理及相关服务，信用卡电话、磁卡电话和传真。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4816', '计算机网络/信息服务', '信息与计算机服务', '居民服务与商业服务', '主要指基于计算机的网络接入服务（包括互联网管理、数据、图像传输服务等），以及所有提供网络接入服务的商户，如网吧。不包括：基于网络开展销售服务的互联网商户，应设置说明其主营业务性质的MCC。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4821', '电报服务', '信息与计算机服务', '居民服务与商业服务', '主要提供电报和其他非语音服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4899', '有线和其他付费电视服务', '信息与计算机服务 ', '居民服务与商业服务 ', '主要指有线电视、付费电视信号的传送服务。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('4900', '公共事业（ 电力、煤气、自来水、清洁服务）', '居民服务 ', '居民服务与商业服务', '主要指提供电力、燃气，或者其他公用服务，包括水、废弃物处理等。电信服务提供商，应列入4814（电信服务）。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5013', '机动车供应及零配件（批发商）', '批发类 ', '批发类 ', '指农业机械、汽车、摩托车零配件批发。包括：各类相关工具、设备，汽车检测用设备、液压泵、汽车玻璃、电池、汽车电子设备、引擎相关部件等零配件的批发业务。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5021', '办公及商务家具（批发商）', '批发类', '批发类', '指办公家具批发商和供应商。包括：办公桌、老板桌、椅子、橱柜、隔断等相关家具，餐厅用桌椅、公园摆放的桌椅，学校桌椅等的批发和进出口活动。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5039', '未列入其他代码的建材批发（批发商）', '批发类 ', '批发类 ', '各类建筑、装潢材料的批发商和供应商。包括：预制板、成型材料、木材、玻璃材料、铁艺、遮阳棚等的批发和进出口活动。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5044', '办公、影印及微缩摄影器材（批发商）', '批发类 ', '批发类 ', '指办公、影印设备的批发商和供应商。包括：复印机、传真机、微缩影像系统、保险箱（柜）的批发和进出口活动。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5045', '计算机、计算机外围设备（批发商） ', '批发类', '批发类', '指计算机硬件、软件、相关外围设备，以及其他机械设备、数码电子产品的批发业务。包括：计算机显示器、磁盘驱动器、键盘、线缆、打印机、扫描仪、调制解调器等。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5046', '未列入其他代码的商用器材（批发商）', '批发类 ', '批发类 ', '指商用机械、设备等的批发商和供应商。包括：食物烹调设备、度量衡设备、保险箱（柜）、微波炉、烘烤设备、商场设施（模特、收银机等）、制冷设备等。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5047', '牙科/实验室/医疗/眼科医院器材和用品（批发商）', '批发类', '批发类', '指各类医疗器材的批发商和供应商。包括：医疗器械（手术器械、检查设备、化验设备、药房用具等）的批发和进出口；医疗用品（绷带、药棉、注射器、体温计、化验管等）的批发和进出口。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5051', '金属产品服务商和公司（批发商', '批发类 ', '批发类 ', '指建筑、装潢用普通金属材料、金属半成品的批发商和供应商。包括：钢筋、金属管道、金属轨道等批发和进出口活动。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5065', '电器零件和设备（批发商）', '批发类', '批发类', '指电器零配件，通讯器材的批发活动。包括：电磁铁、电容、二极管、三极管、半导体设备等。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5072', '五金器材及用品（批发商）', '批发类', '批发类', '指小五金、工具、水暖部件、照明器材、交电用品及材料的批发和进出口活动。包括：自行车、螺钉、螺帽、垫圈、扳手、锯子和锯条等', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5074', '管道和供暖设备（批发商）', '批发类 ', '批发类 ', '指建筑、装潢用管道和供暖设备的批发商或供应商。包括：电动取暖、对流式暖房器、辐射式取暖、壁炉取暖等设备的批发和进出口活动。太阳能取暖装置和设备的批发和进出口活动。不包括：相关建筑、装潢用的制冷设备的批发和进出口活动，列入 5046（未列入其他代码的商用器材、批发）', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5094', '贵重珠宝、首饰，钟表零售（批发商）', '纺织、服装及日用品专门零售店', '零售业 ', '主要经营高级珠宝首饰销售，如钻石、宝石、玉器及其他贵金属戒指、项链、手镯和耳环等；钟表专买店和专门零售店。此类商户的《企业法人营业执照》的经营范围采用列举方式描述时，应包含“珠宝、首饰、钻戒、玉器、金银制品”等字样。这些商户也可能提供首饰维修服务。首饰、钟表维修服务的专门店，应列入7699（各类维修店及相关服务）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5111', '文具、办公用品、复印纸和书写纸（批发商） ', '批发类 ', '批发类 ', '指各类文具用品、体育用品、工艺美术品、收藏品的批发和进出口活动。包括：文具用品批发，体育用品批发，图书、报刊批发，音像制品及电子出版物批发，玩具、游艺器材、乐器等的批发。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5122', '药品、药品经营者（批发商）', '批发类', '批发类', '指各种化学药品、生物药品、中草药材、中成药及医疗器材的批发和进出口活动。包括：兽用药的批发和进出口活动。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5131', '布料、缝纫用品和其他纺织品（批发商）', '批发类 ', '批发类 ', '指纺织面料、纺织品及日杂品、生活日用品的批发和进出口活动。包括：纺织品、针织品及原料批发，厨房、卫生间用具及日用杂货批发，其他日用品（如，眼镜、家具、灯具、装饰用品、婴儿用品等）的批发。不包括：厨房、餐厅用各种电器设备的批发和进出口，列入5045（计算机、计算机外围设备），电线、插座、开关、市政照明灯具等的批发和进出口活动，列入5072（五金器材及用品）。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5137', '男女及儿童制服和服装（批发商）', '批发类 ', '批发类', '指各类服装的批发活动。包括：服装批发及化妆品及卫生用品的批发。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5139', '鞋类（批发商）', '批发类 ', '批发类 ', '指各类鞋帽的批发和进出口活动。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5172', '石油及石油产品（批发商）', '批发类 ', '批发类 ', '指石油、石油产品的批发商和供应商。包括：石油、汽油、煤油、润滑油、天然气及相关产品的批发和进出口活动。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5192', '书、期刊和报纸（批发商）', '批发类', '批发类', '指图书、期刊、报纸，各类音像制品和电子出版物的批发商和供应商。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5193', '花木栽种用品、苗木和花卉（批发商）', '批发类 ', '批发类 ', '指花木、草坪、鲜花（假花）、盆景等的批发商和供应商。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5198', '油漆、清漆用品（批发商）', '批发类 ', '批发类 ', '指油漆、清漆、墙体涂料的批发商和供应商，也包括相关材料，如颜料、染色剂、刷子、砂纸、滚筒等的批发及进出口活动。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5200', '大型仓储式家庭用品卖场 ', '五金、家具及室内装修材料专卖店 ', '零售业 ', '大型、仓储式、开架销售各类家庭用品的综合商店。此类商户的《企业法人营业执照》的经营范围采用列举方式描述时，应包含“仓储式大卖场”等字样。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5211', '木材和各类建材卖场', '五金、家具及室内装修材料专卖店', '零售业', '主要经营室内装修材料的专门零售商店。包括：1、装饰用石、木、塑料、化纤、石膏等专门零售；2、装修用玻璃的专门零售；3、墙壁、地板及其他物品的贴面、覆盖物的专门零售；4、地板砖的专门零售；5、门窗、开关、插座板线、卫生洁具等的专门零售；6、其他未列明的室内装修材料、设备、零件的专门零售。不包括：建筑小五金零售，列入5251（五金商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5231', '玻璃、油漆涂料、墙纸零售', '五金、家具及室内装修材料专卖店', '零售业 ', '主要经营玻璃、油漆涂料、壁纸的供应商，以及其他墙体装饰材料的专门商店。油漆涂料的批发商，应列入 5039（未分类的建筑材料批发商）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5251', '五金商店', '五金、家具及室内装修材料专卖店', '零售业', '主要经营各类五金产品销售的商店。包括：1、建筑五金（门锁、锁、合页、钉子、螺丝等）零售；2、水暖管道零件（暖气片、水管、接头等）零售；3、手工具（扳手、钳子、锤子、电工工具等）零售；4、其他未列明的五金零售。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5261', '草坪、花园用品商店', '五金、家具及室内装修材料专卖店', '零售业', '主要经营面向公众销售苗圃树苗、灌木及其他苗木，种子、根茎、草皮、化肥、杀虫剂、园艺工具等的商户。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5271', '活动房车经销商 ', '汽车、摩托车、燃料及零配件专门零售 ', '零售业', '主要经营活动房车及其相关设备、零配件等的专卖店。', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5300', '会员制批量零售店', '其他零售商店', '零售业 ', '主要经营整套家庭用品、办公用品设备、办公用具、电子产品、家电、汽车配件等。此类商户主要是仓储式、靠低价大量销售，往往需要会员身份。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5309', '免税商店 ', '其他零售商店', '零售业', '主要经营各类免税礼品和进口商品，往往免征关税。这些商户往往位于机场或者酒店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5310', '折扣商店', '其他零售商店', '零售业', '主要经营各类服装、家用品、室内陈设品、个人护理用品、电子产品等的大型销售商店，并折价出售，定期举行低价促销。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5311', '百货商店', '综合零售', '零售业', '经营的商品品种比较齐全（一般包括各类服装、家居用品、家具、电子产品、化妆品、器皿以及主要的家用电器），经营规模较大（有多个部门独立运作、独立核算）的综合零售活动。包括：1、大型百货商厦、百货大楼、购物中心等；2、大、中、小型百货商场；3、设在宾馆、饭店、写字楼内的综合购物中心。不包括：1、经营食品、日用品等的大型、仓储式超级市场，列入5411（大型仓储式超级市场）；2、连锁便利店、社区内的小型综合便民商店、综合日用杂品销售，列入5331（各类杂货店、便利店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5331', '各类杂货店、便利店', '综合零售', '零售业', '为方便城乡居民，在街道、社区、乡镇、农村、工矿区、学校、交通要道、车站码头、机场等人口稠密地区，开办的小型综合零售商店，一般以开架售货形式或人工服务形式开办，规模较小，没有分门别类，经营品牌有限。包括：1、为社区服务的小型综合商店、小卖部；2、经营时间在15 小时以上（或24 小时）的便利店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5398', '大型企业批发', '批发类 ', '批发类 ', '达到且符合《关于调整批发类商户入网认定标准的通知》（银联业管委〔2009〕6号中关于批发类商户认定标准，并且在成为银联特约商户前，年销售金额3亿元以上；成为银联特约商户后，年跨行交易金额（以单个商户代码为准，下同））1亿元（含）以上的企业，定义为大型企业批发商户。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5399', '其他综合零售', '综合零售', '零售业', '各类日用杂品综合零售活动，但同百货商场比较，一般规模较小。包括：1、综合经营厨具、炊具、餐具、刀具、陶瓷、玻璃器皿，以及清洁、消毒用品等日用杂品的杂货店；2、综合经营服装、干货、五金、家用器皿、室内陈设品、电子产品、家具或化妆品等。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5411', '大型仓储式超级市场 ', '综合零售 ', '零售业 ', '经营食品、日用品等的仓储式超级市场的综合零售活动。一般采用开架售货形式，没有专门的销售员。此类商户经营各类食品，包括各类杂货、肉类、农产品以及奶制品；也可能出售罐装、冷冻、包装食品或者干食品；也经营各类日用品，如有限的家用器皿、清洁用品、个人卫生用品、化妆品、贺卡、书籍杂志、其它家用品和干货等，同时也可能在店内设有出售熟食、肉类、药品或者花卉的专门柜台。此类商户的《企业法人营业执照》的经营范围采用列举方式描述时，应包含“超市、仓储式大卖场、连锁店、便利店”等字样。包括：开架式连锁便利店集团，当其以整体方式签订入网协议，且在同一地区门店数量在20 家以上可使用此MCC。不包括：1、以开架形式销售专营建材、装修用品、服装、电器等专卖店，分别列入相应的专门零售的类别中；2、规模较小的开架式的便民店、便利店，列入5331（各类杂货店、便利店）。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5422', '各类肉类零售商', '食品、饮料及烟草制品专门零售', '零售业', '经营鲜肉、冻肉、腌肉、鱼类、禽蛋、贝类及其它海鲜。包括：1、专营肉、禽、蛋及水产品的零售活动；2、固定摊点的肉、禽、蛋及水产品的零售活动。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5441', '糖果及坚果商店', '食品、饮料及烟草制品专门零售', '零售业', '主要零售糖果、巧克力、坚果、果脯、爆米花等。不包括：以提供饮品、休闲娱乐为主的酒吧、咖啡屋、茶馆（水吧）等饮品店，列入5813（饮酒场所，酒吧、酒馆、夜总会、鸡尾酒大厅、迪斯科舞厅）', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5451', '乳制品店、冷饮店', '食品、饮料及烟草制品专门零售', '零售业', '出售有包装奶制品的零售商户。包括：黄油、奶酪、牛奶、各类冷饮外卖（冰棍、雪糕、可乐、汽水等）的零售。不包括：以提供饮品、休闲娱乐为主的酒吧、咖啡屋、茶馆（水吧）等饮品店，列入5813（饮酒场所，酒吧、酒馆、夜总会、鸡尾酒大厅、迪斯科舞厅）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5462', '面包房、糕点商店', '食品、饮料及烟草制品专门零售', '零售业', '制作并出售烤制类食品的商户，包括饼干、面包、蛋糕以及其他糕点、点心零售商店。包括：后店加工生产，前店销售面包店、糕点店。不包括：以提供饮品、休闲娱乐为主的酒吧、咖啡屋、茶馆（水吧）等饮品店，列入5813（饮酒场所，酒吧、酒馆、夜总会、鸡尾酒大厅、迪斯科舞厅）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5488', '天天发', '餐饮类', '餐饮类', '指各种饮食类经营', '20120918110746', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5499', '各类食品店及专门食品零售店', '食品、饮料及烟草制品专门零售', '零售业', '指其它分类未涉及的食品零售商户。包括：粮油零售店、健康食品及减肥食品店、熟食店、咖啡及茶叶等饮料零售商店、蔬菜水果商店、以及综合菜市场的零售活动。经营汽车燃料的便利店附带的食品零售，列入5541（加油站、服务站）。不包括：以提供饮品、休闲娱乐为主的酒吧、咖啡屋、茶馆（水吧）等饮品店，列入5813（饮酒场所，酒吧、酒馆、夜总会、鸡尾酒大厅、迪斯科舞厅）。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5511', '汽车货车经销商－新旧车的销售、服务、维修、零件及出租', '汽车、摩托车、燃料及零配件专门零售 ', '零售业 ', '主要经营新旧汽车的销售，也可以从事维修或者经营零配件。专门从事汽车维修的，应列入 7538（汽车服务商店，非经销商）。专营汽车出租服务的，列入7512（汽车出租）', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5521', '汽车货车经销商－专门从事旧车的销售、服务、维修、零件及出租 ', '汽车、摩托车、燃料及零配件专门零售 ', '零售业 ', '主要从事旧车经营，包括各类旧车以及名车的二手经营。专门从事汽车维修的，应列入 7538（汽车服务商店，非经销商）。专营汽车出租服务的，应列入7512（汽车出租）', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5532', '汽车轮胎经销商 ', '汽车、摩托车、燃料及零配件专门零售', '零售业 ', '主要经营轮胎及相产品。此类商户也可以从事轮胎安装和维修。专业从事轮胎胎面翻新和修复的，应列入7534（轮胎翻新、维修店）', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5533', '汽车零配件商店 ', '汽车、摩托车、燃料及零配件专门零售', '零售业', '主要经营汽车配件、设备和附件，包括油料、过滤器、零件、排气装备、清洁产品、点火栓、上蜡、除臭剂、雨刷、涂料等。此类商户也可以经营车载音响，主营车载音响等的，应列入 7538（汽车服务商店，非经销商）。维修养护服务中的汽车零配件销售，列入7538（汽车服务商店，非经销商）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5541', '加油站、服务站 ', '汽车、摩托车、燃料及零配件专门零售 ', '零售业 ', '主要经营机动车燃料、燃气及相关产品（如润滑油）的零售商户。如车用燃料。这类商户也可以有便利店、洗车、汽车维修等服务，但主营业务必须为汽车燃料零售。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5542', '自助加油站 ', '汽车、摩托车、燃料及零配件专门零售 ', '零售业 ', '主要通过自动售货机零售汽车燃料。自动售油器可以使持卡人自行完成燃料添加。这些交易可能不需要持卡人签名。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5551', '船只经销商 ', '汽车、摩托车、燃料及零配件专门零售 ', '零售业 ', ' ', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5561', '旅行拖车、娱乐用车销售商', '汽车、摩托车、燃料及零配件专门零售 ', '零售业', '主要经营新旧娱乐拖车及其零配件销售，包括有蓬拖车的买卖。', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5571', '摩托车商店和经销商', '汽车、摩托车、燃料及零配件专门零售 ', '零售业', '主要经营各类摩托车、电动车销售及相关零配件销售的商店。与汽车通用的零部件的零售，应列入5533（汽车零配件商店）。', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5592', '露营、房车销售商 ', '汽车、摩托车、燃料及零配件专门零售 ', '零售业 ', '主要经营新旧露营、旅行汽车及其配件的销售商。', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5598', '雪车商 ', '汽车、摩托车、燃料及零配件专门零售 ', '零售业 ', '主要经营雪上用车及其相关零配件的专卖店。', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5599', '汽车、飞行器、农用机车综合经营商 ', '汽车、摩托车、燃料及零配件专门零售 ', '零售业 ', '主要经营新旧汽车、房车以及其配件、原料等其它代码未涉及的领域的销售商。此类商户经销全地形车、高尔夫运球车、卡丁车、飞行器以及拖拉机、联合收割机等农场机械。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5611', '男子和男童服装及用品商店', '纺织、服装及日用品专门零售店', '零售业', '主要经营男士及男孩成衣及饰件（包括领带及帽子）的商店。该类商户也可能经营鞋类，但如果是以鞋类销售为主营业务，应列入 5661（鞋店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5621', '妇女成衣商店', '纺织、服装及日用品专门零售店', '零售业 ', '主要经营各类女性成衣（包括专营女士外套、西装、婚纱、孕妇装等）的商店。该类商户也可能经营鞋类，但如果是以鞋类销售为主营业务，应列入 5661（鞋店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5631', '女性用品商店', '纺织、服装及日用品专门零售店', '零售业', '主要经营女性饰品（包括专门经营诸如手提袋、帽子、围巾、腰带、发卡、贴身内衣及袜类等）的商店。该类商户也可能经营鞋类，但如果是以鞋类销售为主营业务，应列入 5661（鞋店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5641', '婴儿、儿童服装店', '纺织、服装及日用品专门零售店', '零售业 ', '主要经营儿童及婴幼儿服饰挂件等商品。该类商户也可能经营鞋类，但如果是以鞋类销售为主营业务，应列入 5661（鞋店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5651', '家庭服装商店', '纺织、服装及日用品专门零售店', '零售业', '主要经营男女老幼各类服饰的商户。该类商户也可能经营鞋类，但如果是以鞋类销售为主营业务，应列入 5661（鞋店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5655', '运动服饰商店', '纺织、服装及日用品专门零售店', '零售业', '主要经营各类运动服装的商店。此类商户也包括那些专业销售马术类、摩托及赛车服等服饰的商店。该类商户也可能经营鞋类，但如果是以鞋类销售为主营业务，应列入 5661（鞋店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5661', '鞋店', '纺织、服装及日用品专门零售店', '零售业', '主要经营各类鞋子（包括运动鞋）的商店。该类商户也经常附带经营手提袋、袜类、鞋饰手套等相关商品。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5681', '皮货店', '纺织、服装及日用品专门零售店', '零售业', '主要从事毛皮制品（包括外套、夹克、帽子、手套等）的商店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5691', '成人成衣店', '纺织、服装及日用品专门零售店', '零售业', '主要经营成人服饰的商店。婴儿儿童服饰，列入5641（婴儿、儿童服装店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5697', '裁缝、修补、改衣店 ', '纺织、服装及日用品专门零售店', '零售业', '主要经营量身定制及提供服装修补等相关服务的商店。也包括从事旧衣修复或者套装加工服务的商店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5698', '假发商店', '纺织、服装及日用品专门零售店', '零售业', '主要经营长久或者临时使用的假发的商店。此类商店可能也提供织发服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5699', '各类服装及饰物店', '纺织、服装及日用品专门零售店', '零售业', '主要经营除了毛皮之外，其它商户分类所不包括的专用服饰的商店。包括：雨衣、泳衣、制服、礼服等的专门零售商店。不包括：皮毛类商品的主营商店，应列入5681（皮货店）。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5712', '家具、家庭摆品、家用设备零售商', '五金、家具及室内装修材料专门零售', '零售业', '主要经营家庭摆设、家具及配件的商店。如，床、床垫、各类家具、婴儿家具、灯饰、小地毯和帏帐等。也包括办公家具专门零售和其他未列明的家具专门零售。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5713', '地板商店', '五金、家具及室内装修材料专门零售 ', '零售业 ', '主要经营地毯、小垫毯、地砖、地面装饰石材、木头地板等的地面装饰材料的商店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5714', '帏帐、窗帘、室内装潢商店', '五金、家具及室内装修材料专门零售', '零售业', '主要经营窗帘、软式百叶窗、遮阳棚、以及其他装饰材料的商店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5718', '壁炉、壁炉防护网及配件商店', '五金、家具及室内装修材料专门零售', '零售业', '主要经营壁炉、木炉、及壁炉配件等的商店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5719', '各种家庭装饰专营店', '五金、家具及室内装修材料专门零售', '零售业', '主要经营各类家具、家庭用品的商店，如家用器皿、餐具、厨具、灯具、镜子、镜框、小饰品、木制、塑料、皮革日用品等。专营陶瓷、玻璃、水晶制品的商店，应列入5950（玻璃器皿和水晶饰品店）。专营清扫、清洗用品、保健辅助治疗器材的专门零售店，列入 5999（其他专门零售店）。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5722', '家用电器商店', '家用电器及电子产品专门零售', '零售业 ', '主要经营家用电器的综合零售商，如电视机、录像机、影碟机、学习机，冰箱、洗衣机、空调，随身式收音机、收录机，日用小电器及其他家用电器的综合零售。此类商户的《企业法人营业执照》的经营范围采用列举方式描述时，其第一项排序应为“家电、家用电器”。家用电器的维修服务，应列入7622（电器设备维修）或7629（电器设备、小家电维修）。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5732', '电子设备商店', '家用电器及电子产品专门零售 ', '零售业', '主要经营各类电子、数码产品的专营店，如计算机主机、外部设备（扫描仪）、相关配件、耗材及机房设备的专门零售，以及各类数码产品、音响组件、掌上电脑、电子记事本等的专门零售。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5733', '音乐商店－乐器、钢琴、乐谱', '文化、体育用品及器材专门零售', '零售业', '主要经营乐器销售、乐谱、键盘、教科书、钢琴、吉他和相关商品的商店。此类商户可能同时提供音乐教育培训服务。但主营音乐教育培训服务的商店，应列入 8299（其他学校和教育服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5734', '计算机软件商店 ', '家用电器及电子产品专门零售', '零售业', '主要经营私人及商用电脑软件程序销售的商店。此类商户也可能出售或者租赁电脑硬件或相关产品，主营此业务的，应列入5732（电子设备商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5735', '音像制品商店', '文化、体育用品及器材专门零售', '零售业', '主要经营以光盘、磁带等为介质的视听出版物的商店，如CD、VCD、DVD等录音、录像制品的零售。包括：1、音像制品专门零售店和固定摊点零售；2、其他电子出版物的专门零售和固定摊点零售。不包括：主要从事录像带或者DVD 租赁，应列入 7841（音像制品出租商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5811', '包办伙食，宴会承包商', '商业服', ' 居民服务与商业服 ', '主要指与客户签订合同专门制作并派送伙食的商户。如，大型宴会承包商。此类商户也可能提供餐桌、装饰用品以及现场人员服务。餐馆也可从事伙食包办。主营餐饮堂吃服务的，，应列入 5812（就餐场所和餐馆）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5812', '就餐场所和餐馆', '餐饮业 ', '住宿、餐饮与休闲娱乐业', '主要提供各种中、西式炒菜、主食，并由服务员送餐上桌的餐饮服务商户。包括：1、宾馆、饭店、酒店内独立（或相对独立）的酒店、餐厅；2、各种以正餐为主的酒楼、饭店、饭馆及其他用餐场所；3、以自助餐形式提供的餐饮服务；4、各种以涮、烤为主的餐饮服务；5、车站、机场、码头内设的独立的餐饮服务；6、火车、轮船上独立的餐饮服务。不包括：各类特色小吃店，单一类食品的餐饮服务（如，饺子、包子、面条、米粉等），应列入5814（快餐店）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5813', '饮酒场所（ 酒吧、酒馆、夜总会、鸡尾酒大厅、迪斯科舞厅） ', '餐饮业 ', '住宿、餐饮与休闲娱乐业', '主要提供以饮料和冷饮服务的商户。提供座位，并有服务人员进行相关服务。包括：各类茶馆、酒吧、咖啡厅、冷饮店（提供堂吃服务）以及其他形式的饮料服务。不包括：1、以销售蛋糕、面包为主的乳品店、面包房，应列入 5462（面包房、糕点商店）；2、可乐、矿泉水等饮料的柜台销售及流动销售，应列入5451（乳制品店、冷饮店）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5814', '快餐店 ', '餐饮业 ', '住宿、餐饮与休闲娱乐业', '主要经营成品食物的商店。可堂吃也可外卖，但服务员一般不送餐上桌，由顾客自己领取食物。可提供不下车窗口服务。此类商户的单笔交易金额一般较低。不包括：以自助形式提供的餐饮服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5912', '药店、药房', '医药和医疗器材专门零售', '零售业', '主要经营各类中西药品，销售医疗处方、处方药和非处方药的商店。此类商户也可以同时销售诸如化妆用品、计划生育和性保健用品，以及部分医药、医疗器材一体的专门零售店等相关商品。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5921', '瓶装酒零售店', '食品、饮料及烟草制品专门零售', '零售业', '主要经销包装完整的酒类，如淡色啤酒、啤酒、葡萄酒、烈酒等，所售酒类均不在店内饮用。此类商户也可能经营食品、零食、报刊杂志、化妆品以及非处方类药品。不包括：以提供饮品、休闲娱乐为主的酒吧、咖啡屋、茶馆（水吧）等饮品店，列入5813（饮酒场所，酒吧、酒馆、夜总会、鸡尾酒大厅、迪斯科舞厅）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5931', '旧商品店、二手商品店 ', '其他零售商店', '零售业 ', '主要经营旧货和二手货的商户。这些产品包括装饰品、鞋类、衣服、家具、书籍、自行车、乐器、缝纫机、电子设备、家电及其它家庭用品。通常情况下，这些商品属于捐赠或者寄售。该类商户也可能经营古董。主营古董销售的，应列入 5932（古玩店－出售、维修及还原）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5932', '古玩店－出售、维修及还原', '文化、体育用品及器材专门零售 ', '零售业 ', '主要经营具有收藏价值和艺术价值的工艺品、艺术品、家具、珠宝、古玩、字画、邮品等的零售商店。也包括在旅游景点销售土特产和手工艺品的零售商店（不含特色食品）。此类商户也可能从事修复工作，但商户主要从事维修和修复古董工作的，应列入 5937（古玩复制店）。室内小装饰、小礼品的专门零售店，应列入5719（各种家庭装饰专营店）。专门经营名车零售的商户，应列入5521（汽车货车经销商）', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5933', '当铺 ', '金融业 ', '房地产与金融业', '主要经营以私人财产作为抵押，发放放贷的商户。如果抵押方不能按期归还贷款，当铺可以把抵押的私有财产公开出售。一般情况下，被抵押财产包括珠宝、手表、乐器、自行车、家具、古币及摄像器材。', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5935', '海上船只遇难救助', '商业服务', '居民服务与商业服务', '主要从事海上遇难救援或者打捞的商户。主要提供拖车服务的，应列入7549（拖车服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5937', '古玩复制店', '文化、体育用品及器材专门零售', '零售业', '主要经营衣服、家具、地毯、工艺品、艺术品、镜子、玻璃器具、珠宝、及其他家庭和私人用品等复制品的商店。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5940', '自行车商店', '文化、体育用品及器材专门零售', '零售业 ', '主要经营自行车及自行车零配件的商店。此类商户可能同时销售有限的相关产品，如运动服饰，或者附带提供自行车修理服务。商户主营修车服务时，应列入 7699（各类维修店及相关服务）。此类商户还可能附带经营自行车出租服务。商户主营自行车出租服务，应列入 7299（未列入其他代码的其他个人服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5941', '体育用品店', '文化、体育用品及器材专门零售', '零售业', '主要经营各类运动装备和运动器材的商店。包括：1、滑雪板、滚轮滑冰、冲浪板、高尔夫器材、滑雪、水上运动各类运动器材的销售。2、户外旅游、探险、登山、渔具等各项运动装备和运动器材的销售。不包括：以体育服装为主的零售，应列入5655（运动服饰商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5942', '书店', '文化、体育用品及器材专门零售', '零售业 ', '主要经营各类图书、期刊、杂志、课本、地图、音像制品和日历的专卖店。如，新华书店、外文书店、中国书店、图书大厦及其他各类书店的零售活动。也可用于宗教图书销售的商店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5943', '文具用品商店、各类办公用品商店', '文化、体育用品及器材专门零售 ', '零售业', '主要经营办公室、学校用品的专卖店。包括：1、学生、办公文具等的专门零售店和固定摊点零售；2、纸张、账簿等的零售；3、测绘、制图、计量用品等的专门零售和固定摊点零售；4、美术用品（画笔、水彩、油彩、画板、画框、刻刀等）的专门零售；5、其他文具用品专门零售。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5944', '银器店', '纺织、服装及日用品专门零售店', '零售业', '主要经营各类纯银饰品、镀金餐具等的销售，如银首饰、盘子等。这些商户也可能提供相关维修服务。首饰、钟表维修服务的专门店，应列入7699（各类维修店及相关服务）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5945', '玩具、游戏店', '文化、体育用品及器材专门零售 ', '零售业 ', '主要经营玩具、各类游戏、DIY 手工制作及培养爱好的成套工具。专门经营工艺品配件、原料、设备和附件的商户，应列入5970（工艺美术商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5946', '照相器材商店', '文化、体育用品及器材专门零售 ', '零售业', '主要经营照相器材的专卖店和专门零售店（如照相机、胶片、相片冲印化学试剂、相纸及其他摄影器材等）。此类商户可能同时提供照相冲洗服务。主要从事相片冲印的，应列入7395（照相洗印服务）。不包括：1、广告公司、专业艺术设计公司的商业摄影、工艺和绘图服务，应列入7333（商业摄影、工艺、绘图服务）；2、销售相机、摄像机设备，及其他电子设备（如影碟机、电视、高级音像等）的，应列入 5732（电子设备商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5947', '礼品、卡片、装饰品、纪念品商店', '纺织、服装及日用品专门零售店', '零售业', '主要经营各类礼品、新奇商品、贺卡、气球、纪念品、节日装饰、包装纸及纸板、相册，及少部分办公用品（笔、纸、尺子和日历）等的商户。不包括：1、商户《企业法人营业执照》的经营范围列举有“珠宝、首饰、钻戒、玉器、金银制品”的，应列入5094（贵重珠宝、首饰，钟表零售）。2、主营销售文具用品的，列入 5943（文具用品商店、各类办公用品商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5948', '箱包、皮具店', '纺织、服装及日用品专门零售店', '零售业 ', '主要经营各类箱包、皮具销售的商户。包括：行李箱、公文包、皮背包、钱包、手套及其他皮具，以及皮衣制品等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5949', '纺织品及针织品零售', '纺织、服装及日用品专门零售店', '零售业', '主要经营织品、图案、纱线、及其它缝纫用品，如线，纽扣、摁扣、衬里。蕾丝花边、剪刀及拉链。主要经营棉纺面料、毛纺面料、丝绸面料、化纤面料的专门零售店和固定摊点零售。各类针织品、床上用品、窗帘用品、桌布、装饰布、毛巾、手绢及其他纺织日用品的专门零售店和固定摊点零售。该类商户也可以提供缝纫课程。但如果主要从事缝纫培训，则应列入 8299（其他学校和教育服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5950', '玻璃器皿和水晶饰品店', '纺织、服装及日用品专门零售店', '零售业', '主要经营陶瓷、瓷器、水晶制品的商店，如各类摆件、礼品等。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5960', '保险直销 ', '直销商户 ', '直销类商户 ', '保险服务营销可能通过电话、杂志、夹寄账单或者电视广告等方式进行直销。潜在客户通过电话回复或者邮寄回复来确认参加此项服务。保险服务包括寿险、医疗保险、意外事故死伤保险，和信用卡保险等所有险种，向特定目标人群进行直销。保险账单按照一定周期分期支付，直到持卡人和保险公司同时提出中止服务。保险代理机构不得使用该商户类别码。例如：保险公司通过在对账单中夹寄保险账单招徕持人参与保险服务。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5962', '旅游相关服务直销', '直销商户', '直销类商户', '通过直销方式销售的各类旅游服务、旅游折扣俱乐部、旅游服务订购等。此MCC 只应用于旅游产品直销商户。一般旅行社使用MCC 4722（旅行社）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5963', '门对门销售 ', '直销商户', '直销类商户', '指上门销售商品的销售形式。比如化妆品、家用小商品、乳制品和杂志订阅服务等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5964', '目录直销商户', '直销商户', '直销类商户', '商品信息通过纸制或电子目录向消费者提供。使用这个商户类别码的商户不得从事零售（面对面）交易。例如：电视直销服务，目录服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5965', '目录、零售兼营商户 ', '直销商户', '直销类商户', '商品信息通过纸制或电子目录向消费者提供，持卡人一般通过邮件、电话（传真）或者互联网发送订单。此MCC 也包括将商品运送至特定店铺，由持卡人自行提货的交易方式。商户也通过分店进行零售。这类商户需要区分直销和零售业务，分别为商户命名并编写商户代码。目录直销必须填写MCC 5965，而面对面的零售必须填写与零售业务相应的正确商户类别码。例如：百货公司及其目录销售子公司，电器、运动服装设备、食品等同时通过目录和零售销售。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5966', '电话呼出直销', '直销商户', '直销类商户', '直销员通过呼出电话的方式推销产品。一般而言，直销人员首先通过电话或者邮件（不是目录）与潜在购买方建立联系，并在电话或者邮件中告知持卡人若需要购买商品或服务可与直销商户取得联系。在各种情况下，交易都是在卡片不在现场的情况下完成的。例如：化妆品、保健品、维生素等电话推销活动。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5967', '电话呼入直销', '直销商户', '直销类商户', '持卡人主动发起，通过传真、电话等方式取得商品或服务（如音像服务）。这个MCC 主要用于信息提供服务或者通过这种渠道销售产品的服务。例如：星座读物，按每次呼叫收费服务，股票行情信息服务等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5968', '订阅/订购直销服务', '直销商户', '直销类商户', '基于持卡人预定，定期（按月、季）提供的产品或服务。例如：唱片、磁带或者CD 俱乐部，期刊订阅。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5969', '其他直销商户', '直销商户', '直销类商户', ' ', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5970', '5970', '纺织、服装及日用品专门零售店', '零售业', '主要经营艺术品原料、工艺制作原料、设备的商店。此类商户的《企业法人营业执照》的经营范围采用列举方式描述时，应包含“工艺、工艺品、美术、美术品”等字样。包括：经营黏土、各种颜料、画笔、丝绒花饰、钢笔、铅笔、纸张、从事业余爱好或者工艺制作所需的成套工具、纱绒、珠子、织品及其它缝纫饰品的零售商店。不包括：专门从事缝纫或织品经营的应列入 5949（纺织品及针织品零售）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5971', '艺术商和画廊', '纺织、服装及日用品专门零售店', '零售业', '主要经营艺术品，如画作、照片、雕刻品等。《企业法人营业执照》此类商户的《企业法人营业执照》的经营范围采用列举方式描述时，应包含“工艺、工艺品、美术、美术品”等字样。包括：各类艺术品经营商、艺术家自营或者画廊。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5972', '邮票和纪念币商店', '纺织、服装及日用品专门零售店', '零售业', '主要经营邮票、硬币以及与集邮和硬币收集与投资相关物品的商店。不包括通过国家邮政机构提供邮票的，应列入9402（国家邮政服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5973', '宗教品商店 ', '纺织、服装及日用品专门零售店 ', '零售业', '主要经营宗教物品的销售商店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5975', '助听器－销售、服务和用品', '纺织、服装及日用品专门零售店', '零售业', '主要经营助听设备及相关产品的商户。此类商户可提供维修服务。但当商户的主要业务是维修服务时，列入7699（各类维修店及相关服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5976', '假肢店（整形外科用品、辅助设备）', '医药和医疗器材专门零售', '零售业', '主要经营整形外科物品和辅助设备，包括拱形防护、足部保护设备、骨折治疗设备、轮椅、腹部防护设备、矫形背带、假肢等。此类商户可能同时提供相关物品、设备的修理服务。主营设备修理服务的，应列入7699（各类维修店及相关服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5977', '化妆品商店', '纺织、服装及日用品专门零售店', '零售业', '主要经营化妆品销售的商店，也可用于戏剧化妆、日常化妆用品的销售。包括：1、香水的专门店和专门零售店；2、护肤品及化妆品的专卖电和专门零售店；3、妇女卫生用品、洗漱清洁用品专门店和专门零售店；4、其他未列明的化妆品及卫生清洁用品的零售。不包括：日常生活清扫、清洗用品的专门零售，列入5999（其他专门零售店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5978', '打字机商店－销售、服务和出租', '家用电器及电子产品专门零售 ', '零售业 ', '主要提供打字机销售、出租和服务的商店。此类商户可同时提供相关办公设备的销售。主营办公设备销售的，应列入5943（文具用品商店、各类办公用品商店）。与计算机相关的其他辅助设备零售，应列入5732（电子设备商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5992', '花店 ', '五金、家具及室内装修材料专门零售 ', '零售业', '主要经营鲜花、插花和盆景的商店。此类商户可能也出售部分新奇商品，如氢气球。专营销售花种、根茎、花苗等的商户，应列入5261（草坪、花园用品商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5993', '香烟、雪茄专卖店', '食品、饮料及烟草制品专门零售', '零售业', '烟草、香烟、雪茄等的专卖店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5994', '报亭、报摊', '文化、体育用品及器材专门零售', '零售业 ', '指固定报刊销售点、报亭、报摊的零售活动（包括流动摊位）。通过国家邮政提供的报纸订阅服务，应列入9402（国家邮政服务）', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5995', '宠物商店、宠物食品及用品', '纺织、服装及日用品专门零售店', '零售业', '主要经营各类宠物食品和用品的商店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5996', '游泳池－销售、供应和服务', '文化、体育用品及器材专门零售', '零售业', '主要经营家用游泳池设备、SPA、洗浴设备销售的商户。这些商户可能提供维修服务。主营此类设备维修的，应列入 7699（各类维修店及相关服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5997', '电动剃刀商店－销售和服务', '家用电器及电子产品专门零售 ', '零售业', '主要经营电动剃刀销售的商店。此类商户可提供维修服务。专营电动剃刀维修服务的，应列入 7699（各类维修店及相关服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5998', '其他批发商 ', '批发类 ', '批发类 ', '以上代码未列明的批发业务，如烟草、农副产品。', ' ', '004', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('5999', '其他专门零售店', '其他零售商店', '零售业 ', '未列入其他代码的专门零售店，如清扫、清洁日用品的专门零售店、保健辅助医疗器材的专门零售店、家用、商用帐篷、遮阳棚商店、地图专卖店、魔术商店、焰火店、书画装裱店、桶装水销售店等。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('6010', '金融机构－人工现金支付', '金融业', '房地产与金融业', '主要指商业银行等金融机构柜台发起的，与卡片相关的活动。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('6011', '金融机构－自动现金支付', '金融业', '房地产与金融业', '主要指商业银行自助终端发起的相关交易和活动。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('6012', '金融机构－商品和服务', '金融业', '房地产与金融业', '商业银行发起的其他相关服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('6051', '非金融机构－外币兑换、非电子转帐的汇票、临时支付凭证和旅行支票 ', '金融业', '房地产与金融业', '主要指外汇、黄金、钻石交易活动和其他融资活动，主要针对外币、旅行支票的购买，也包括在交易所、现金订单商户、宾馆等非金融机构进行的储值卡转帐。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('6211', '证券公司－经纪人和经销商', '金融业', '房地产与金融业', '主要提供证券、期货经纪代理人的代理交易服务；证券、基金的管理服务；证券营业部的管理服务的各类机构。包括：证券公司的证券交易代理活动（如证券公司在各地开办的证券营业部）；期货经纪公司的期货交易代理活动；基金管理公司的基金管理活动等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('6300', '保险销售、保险业和保险金', '金融业 ', '房地产与金融业 ', '主要提供保险代理、销售、评估、监督、咨询等服务的机构。包括：保险代理的活动；保险经纪人的活动；保险咨询的活动；其他保险辅助活动（精算、理赔、调查、评估服务）。不包括：强制性养老保险，列入社会保障业，应列入9399（未列入其他代码的政府服务，社会保障服务，国家强制）。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('6513', '不动产管理－物业管理', '维修及其他专业服务', '居民服务与商业服务', '主要指物业管理企业依照合同约定，对物业进行专业化维修、养护、管理，以及对相关区域内的环境、公共秩序等进行管理，提供相关服务。包括：住宅小区、住宅楼、公寓、别墅、度假村等物业管理；综合楼、办公楼、写字楼、商场、商厦、购物中心、酒店、康乐场所等物业管理；其他物业管理。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7011', '住宿服务（ 旅馆、酒店、汽车旅馆、度假村等）', '住宿业 ', '住宿、餐饮与休闲娱乐业', '主要提供住宿服务的商户。此类商户的《企业法人营业执照》的经营范围采用列举方式描述时，应包含“经营住宿”等字样。如提供床、早餐的小屋、别墅、旅舍、旅馆等，以及提供住宿预定服务的预定中心。包括：1、按照国家有关规定评定的旅游饭店或具有同等质量、水平的饭店。如被评定为星级的宾馆、饭店、酒店；被评定的旅游（涉外）宾馆、饭店、酒店；具有旅游饭店服务水平的宾馆、饭店、酒店、旅馆等；具有旅游饭店同等水平的度假村、避暑山庄；各单位自办的具有旅游饭店服务水平的招待所；对外提供住宿服务（提供散客、组团的旅游、出差、商务、休闲等住宿）为主，具有旅游饭店同等水平的会议中心、培训中心、疗养院等。2、不具备评定旅游饭店和同等水平饭店的一般旅馆的活动。如，各类旅馆、旅社、客栈；不具备旅游饭店服务水平的招待所（不论是否对外提供服务）。3、城镇、乡村的家庭旅馆服务等。不包括：1、房屋出租活动， 应列入7013（不动产代理－房地产经纪）。2、露营地、夏令营、临时帐篷驻地，列入居民服务和其他专业服务，MCC 为7032（运动和娱乐露营地）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7012', '分时使用的别墅或度假用房', '住宿业 ', '住宿、餐饮与休闲娱乐业', '指出售、出租分时使用的房地产、以及分时用房的管理服务。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7013', '不动产代理－房地产经纪 ', '房地产业 ', '房地产与金融业 ', '主要提供个人或者商业不动产代理、经纪服务的机构。包括租房佣金和房租支付等。', ' ', '002', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7032', '运动和娱乐露营地', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要指筹划、运作以运动训练、娱乐、或者教育为内容的儿童训练营和各类集中活动。如，钓鱼、打猎等的集中活动，各种夏令营、冬令营等。帐篷、活动房车野营活动，应列入 7033（活动房车场及露营场所）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7033', '活动房车场及露营场所', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要提供娱乐车、房车、帐篷等过夜野营场地的服务商。这些商户可能为露营者提供水电供应，但是这些水电供应应位于野营场地之内。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7210', '洗衣店', '居民服务', '居民服务与商业服务', '主要指专营的洗染店以及在宾馆、饭店内常设的独立（相对独立）洗染服务，通常是利用蒸汽或其他方法洗衣清洁的服务，服务范围包括制服、礼服、围裙、桌布、床罩、毛巾及其它类似的如尿布。尿布清洗包括上门收取、清洗及送货服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7211', '洗熨服务（自助洗衣服务）', '居民服务', '居民服务与商业服务', '主要提供投币式自助洗衣及烘干服务，或者按照重量来收取费用的针对普通用户的洗衣服务。有时自动洗衣店，可位于宿舍、公寓楼或者其它类似场所。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7216', '干洗店', '居民服务', '居民服务与商业服务', '主要提供个人或者企业的干洗服务，包括衣物、窗帘、婚纱及床上用品、也可以提供适量的服装修补和旧衣修复服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7217', '室内清洁服务（地毯、沙发、家具表面的清洁服务）', '居民服务', '居民服务与商业服务', '主要提供商业场所或者住所的清洗服务，如地毯、窗帘以及内部装饰清洗等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7221', '摄影工作室', '居民服务', '居民服务与商业服务', '主要提供面向公众的静态摄影、摄像、肖像摄影等服务的商户。包括：婚礼摄影服务，艺术摄影服务，一般照相馆服务以及其他相关服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7230', '美容理发店', '居民服务', '居民服务与商业服务', '主要提供专业理发、美容服务，以及在宾馆、饭店或娱乐场所常设的独立（相对独立）理发、美容服务。如剪发、发型设计、染发等。此类商户还可以提供修甲、修脚，并出售美容、护肤、减肥、洗发、护发等用品。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7251', '修鞋店、擦鞋店、帽子清洗店', '维修及其他专业服务', '居民服务与商业服务', '主要指提供修鞋、皮鞋清理和上光服务的商户，也包括帽子清洗店。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7261', '殡葬服务', '居民服务', '居民服务与商业服务', '主要提供与殡葬有关的各类服务的商户。包括：火化、殡葬礼仪服务；遗体搬运存放服务；骨灰存放服务；殡仪管理服务；墓地安葬服务；殡葬用品服务（买花圈、寿衣等）；其他殡葬服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7273', '婚姻介绍及陪同服务', '居民服务', '居民服务与商业服务', '主要提供从事婚姻介绍、婚庆等服务的商户。包括：1、婚姻介绍所、电子红娘，以及专门为未婚男女提供联谊活动的机构；2、婚庆公司，以及专门为婚礼提供汽车、服装道具、摄像、照相、宴请、送礼等服务的机构。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7276', '税收准备服务', '商业服务', '居民服务与商业服务', '主要从事个人收入所得税返还准备服务的商户，不包括审计、会计和帐簿管理服务。提供审计、会计和记账服务的机构，提供退税服务的，应列入 8931（会计、审计、财务服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7277', '咨询服务－债务、婚姻和私人事务', '商业服务', '居民服务与商业服务', '主要提供咨询服务的机构，如债务、理财咨询，婚姻咨询，家庭咨询，酒精、药物咨询，以及其他个人事务咨询。提供相关法律事务咨询，应列入8111（法律服务和律师事务所服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7278', '购物服务及会所（贸易、经纪服务）', '商业服务', '居民服务与商业服务', '主要提供商品经纪、商品代理、拍卖等服务的商户；专门为某一生产企业做销售代理的商户；为买卖双方提供贸易机会或代表委托人进行商品交易代理的商户等。通常，这些商户不直接拥有货物，只从事批发和进出口的代理活动，为某一特定生产者的产品做销售代理，或其他贸易经济代理活动，且不直接向消费者出售商品，而是居中促成交易达成。包括：对大宗商品的拍卖，对古董、古玩、字画及其他单件物品的拍卖活动，对罚没物品拍卖及与司法行政有关的拍卖。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7295', '家政服务', '居民服务', '居民服务与商业服务', '主要提供面向居民大众的各种家庭服务的商户。包括：1、保姆、家庭护理、厨师、洗衣工、园丁、门卫、司机、教师、私人秘书服务等；2、病床临时护理和陪诊服务。不包括：1、介绍劳务人员的劳务公司、三八服务社等，列入7361（职业中介、临时工）；2、专为老人、五保户、残疾人员、残疾儿童等提供的看护、帮助活动，列入9399（未列入其他代码的政府服务，社会保障服务，国家强制）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7296', '出租衣物－服装、制服和正式场合服装', '出租和租赁服务', '居民服务与商业服务', '主要提供各类服装（制服、正装、晚礼服等）的出租。各类服装的批发商户，应列入 5137（男女及儿童制服和服装）', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7297', '按摩店', '休闲娱乐业', '住宿、餐饮及休闲娱乐业', '主要提供专业治疗性按摩服务的场所，以及在宾馆、饭店或娱乐场所常设的独立（相对独立）的按摩保健类休闲场所。包括面部护理、足部护理等。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7298', '保健及美容SPA', '休闲娱乐业', '住宿、餐饮及休闲娱乐业', '主要提供各种美容、整容、治疗性的保健服务的商户，包括面部护理、按摩、泥疗浴、草药保健、肤色保健、蒸气浴、个人保健咨询、饮食咨询、外形化妆咨询等。专业洗浴室，以及在宾馆或娱乐场所常设的独立（或相对独立）洗浴休闲场所。如，洗澡、洗浴服务、温泉、芳香浴、桑拿服务等。这些商户可能会提供临时住宿。但是，如果商户提供一揽子SPA 服务（包括住宿、正餐、个人保健护理、分级服务等），应列入 7011（住宿服务－旅馆、酒店、汽车旅馆、度假村等）。不包括：1、健美健身服务，列入休闲健身娱乐服务，应列入7997（会员俱乐部，体育、娱乐、运动等、乡村俱乐部以及私人高尔夫课程班）；2、医疗护理服务，列入卫生类相关代码。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7299', '未列入其他代码的个人服务（其他房地产服务）', '房地产业', '房地产与金融业', '指上述未包含的其他房地产活动等。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7311', '广告服务', '商业服务', '居民服务与商业服务', '主要提供有偿客户策划制作服务商户。提供文字广告、广告美术设计、图表制作、广告创意等方面广告制作服务，并将广告在报纸、期刊、户外路牌、灯箱、橱窗、互联网、通讯设备及广播电影电视等媒介上进行投放。此MCC 也可运用于提供航空广告、样品发放、户外平面广告制作等服务的广告商。包括：广告策划、公关、市场调研，广告设计、制作，广告发布、宣传、展示活动，广告代理，流动广告（汽车、自行车），广告宣传品的发送等活动。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7321', '消费者信用报告机构', '商业服务', '居民服务与商业服务', '主要提供消费者信用报告服务的机构，比如信用调查、征信服务，以及其他相关服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7333', '商业摄影、工艺、绘图服务', '商业服务', '居民服务与商业服务', '主要提供面向广告公司、印刷出版机构等的商业性图片摄影、设计和制作服务的商户。包括：丝绸印刷设计、静态图片或幻灯片制作、商业美术、图表设计展示等。不包括：向公众提供静态摄影、摄像、肖像摄影等服务的，应列入 7221（摄影工作室）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7338', '复印及绘图服务', '商业服务', '居民服务与商业服务', '主要提供通过扫描、复印等方式复制文档、图画、地图及其他印刷制品的专业商户。包括：电脑排版、印制、装订服务，复印、传真、电话服务，名片印制、刻章服务，电脑喷绘、晒图服务，标志牌、铜牌的设计、制作服务，奖杯、奖牌、奖章、锦旗的设计、制作服务等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7339', '速记、秘书服务（包括各类办公服务）', '商业服务', '居民服务与商业服务', '主要提供翻译、文字处理、打字、编辑、扫描、文书草拟等服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7342', '灭虫及消毒服务', '维修及其他专业服务', '居民服务与商业服务', '主要提供根除害虫及消毒相关服务的上海。如除白蚁、昆虫、啮齿动物以及烟熏等服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7349', '清洁、保养及门卫服务', '维修及其他专业服务 ', '居民服务与商业服务', '主要提供建筑物清洗和维护服务，如窗户清洗、保养、地板上蜡、学校夜间看门、办公室打扫以及看家。可能签合同或者按次付费。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7361', '职业中介、临时工', '商业服务', '居民服务与商业服务', '主要提供职业中介服务的机构，为求职者寻找、选择、介绍、安置工作；为用人单位提供劳动力；提供职业技能鉴定及其他职业中介活动的机构。包括：劳务市场、人才市场，职业介绍所（含保姆、家庭工、钟点工、陪护的介绍公司），家教中介服务（推荐、介绍家庭教师），职业就业中心，劳动服务公司、三八劳务服务社，各类人才公司，外企服务公司（为驻我国的境外企业提供劳动力的机构），劳务输出机构（含向境外派送劳务的机构），职称、职业技能和就业上岗的考试、鉴定服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7372', '计算机编程、数据处理和系统集成设计服务', '信息与计算机服务 ', '居民服务与商业服务', '主要指提供计算机系统的设计、集成、安装等方面的服务。为用户提供数据的录入、加工、存贮等方面的服务，以及使用用户指定的软件加工数据，并将结果返回给用户的活动。包括：办公用计算机系统的设计、集成、安装、调试和管理；生产及其他专业用计算机系统的设计、集成、安装、调试和管理；计算机机房的设计、安装、调试和管理；其他计算机系统的设计、集成、安装、调试和管理；为客户提供数据录入、处理、加工等服务的各类计算中心（站）、公司的活动。不包括：计算机销售、计算机系统咨询和计算机硬件维修。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7375', '信息检索服务', '信息与计算机服务', '居民服务与商业服务', '主要指网络公司通过互联网为客户提供信息的服务。包括：专营各类网站的信息服务（含电子邮件、电子公告、文件传输、新闻、商业、娱乐、服务、搜索分类等信息）；数据库管理（数据库开发、数据收集、数据存储、数据库联机服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7379', '未列入其他代码的计算机维护和修理服务', '维修及其他专业服务', '居民服务与商业服务', '主要指对计算机硬件及系统环境的维护和修理服务。包括：对计算机系统进行维护，为计算机系统排除故障，计算机硬件维修。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7392', '管理、咨询和公共关系服务', '商业服务', '居民服务与商业服务', '主要为企事业单位、个人提供与社会经济有关的咨询、策划、设计活动的机构。这种机构的业务范围较广，包括，经济贸易咨询、教育咨询（含出国留学咨询与中介服务）、战略规划、组织架构设计、财务预算管理，市场发展目标制定、信息系统规划、人力资源政策制定、采购管理和公共关系管理。也包括其他相关咨询服务、知识产权服务、市场管理服务等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7393', '侦探、保安、安全服务', '商业服务', '居民服务与商业服务', '主要提供安全保卫服务的商户，如保镖、武装押运等。也可用于私家侦探、提供护卫犬、监控系统安装维护等服务的商户。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7394', '设备、工具、家具和电器出租', '出租和租赁服务', '居民服务与商业服务', '包括：推土机、压路机、自卸运土车、混泥土搅拌机、塔吊、脚锁架等机械和设备的出租；计算机及辅助设备（打印机、扫描仪等）出租，通讯设备的出租；工具、家具和电器出租活动。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7395', '照相洗印服务', '居民服务', '居民服务与商业服务', '主要提供冲印相片服务和相片放大服务等的商户。这些商户可能提供顾客定制放大，照片翻新等专业服务。这些商户也可能同时出售有限的摄影相关商品，如胶卷、三角架、相册、镜头纸、相框等。主营销售照相设备及相关用品的，应列入 5946（照相器材商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7399', '未列入其他代码的商业服务', '商业服务', '居民服务与商业服务', '主要提供其他代码未能明确的商业服务的机构，如出版公司、会议服务机构、寻呼服务以及废物处理等。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7512', '汽车出租', '出租和租赁服务', '居民服务与商业服务', '包括：主要提供小轿车、旅行车、卡车、拖车、摩托车、活动住房和其他运输设备的出租。不包括：带操作人员的汽车出租，列入4121（出租车服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7513', '卡车及拖车出租', '出租和租赁服务', '居民服务与商业服务', '包括：拖拉机、播种机、收割机、脱谷机等机械设备出租。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7519', '房车和娱乐车辆出租', '出租和租赁服务', '居民服务与商业服务', '主要提供短期出租帐篷、家用房车、拖车及其他娱乐用车辆的商户。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7523', '停车场', '居民服务 ', '居民服务与商业服务 ', '主要提供临时停车服务的商户，往往按小时、按天或按月收取费用。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7531', '车体维修店', '维修及其他专业服务', '居民服务与商业服务', '主要提供汽车车身维修服务的商户，同时提供与车身维修相关的汽车喷漆服务。专营汽车喷漆服务的，应列入 7535（汽车喷漆店）。除汽车车身维修服务以外的汽车维修服务提供商，应列入 7538（汽车服务商店，非经销商）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7534', '轮胎翻新、维修店', '维修及其他专业服务', '居民服务与商业服务', '主要提供出售、安装、维修旧胎或者旧胎翻新等方面的服务。不包括：1、新轮胎销售。2、从事其它汽车维修服务的应列入 7538（汽车服务商店，非经销商）。3、专营新轮胎销售的，应列入 5532（汽车轮胎商店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7535', '汽车喷漆店', '维修及其他专业服务', '居民服务与商业服务', '主要指汽车喷漆，外观翻新维修的商户。也包括汽车保管、改装和喷漆服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7538', '汽车服务商店（非经销商）', '维修及其他专业服务', '居民服务与商业服务', '主要从事汽车维修和一般服务。如维修引擎、刹车、空调系统、排气系统、车身、燃料系统、汽化器、散热器、风挡玻璃、车窗、电路等。也包括快速换油及添加润滑剂以及四轮定位及相关维修。专业从事轮胎胎面翻新和修复的，应列入 7534（轮胎翻新、维修店）。专门从事汽车车身修复的，应列入 7531（车体维修店）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7542', '洗车 ', '维修及其他专业服务', '居民服务与商业服务', '主要提供洗车、上蜡及上光等服务的商户。如自动洗车、手洗以及车主自己洗车等所有场所。如果此处出售汽车燃料，则应列入 5541（汽车加油站）和5542（自助加油站）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7549', '拖车服务', '商业服务', '居民服务与商业服务', '主要提供拖车服务的商户。专门从事海上遇难救援或者打捞的，应列入 5935（海上船只遇难救助）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7622', '电器设备维修', '维修及其他专业服务', '居民服务与商业服务', '主要提供收音机修理、电视修理、影碟机修理等的电器维修服务商。小家电维修服务，例如微波炉、电烤箱等，应列入7629（电器设备、小家电维修）。大型电器维修，如洗衣机、干衣机、洗碗机、电冰箱等，应列入 7699（各类维修店及相关服务）。计算机及其外围设备维修，如打印机、扫描仪的维修，应列入7379（未列入其他代码的计算机维护和修理服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7623', '空调、制冷设备维修', '维修及其他专业服务', '居民服务与商业服务', '主要指家用、商用空调、制冷系统的维修服务提供商。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7629', '电器设备、小家电维修', '维修及其他专业服务 ', '居民服务与商业服务', '主要提供家用、商用小型电器维修服务的商户。如，微波炉、烤炉、烤箱等。包括：办公电器的维修服务。不包括：打字机维修，列入5978（打字机商店？销售、服务和出租）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7631', '手表、钟表和首饰维修店', '维修及其他专业服务', '居民服务与商业服务', '主要提供各类钟表、珠宝、首饰维修服务的商户。主营钟表、高级珠宝销售的商店，应列入 5094（贵重珠宝、首饰和钟表零售）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7641', '家具维修、翻新', '维修及其他专业服务', '居民服务与商业服务', '主要提供家具的翻新和维修服务，也包括对古董家具的复原。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7692', '焊接维修服务', '维修及其他专业服务', '居民服务与商业服务', '主要提供各类焊接服务的商户。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7699', '各类维修店及相关服务', '维修及其他专业服务', '居民服务与商业服务', '其他代码未列明的维修服务使用本代码。包括，大型家电维修（电炉、洗衣机、干衣机、洗碗机、热水器等）、自行车、体育器材维修、助听器、乐器、帐篷和遮阳棚、割草机、箱包皮具的维修。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7829', '电影和录像创作、发行', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要指文学、美术创造和表演艺术（如戏剧、戏曲、歌舞、音乐、舞蹈、曲艺、杂技、马戏、木偶、皮影等表演艺术）等的活动，以及专供文艺团体演出的场所的管理活动。包括：文学（含电影、电视剧剧本）、音乐、歌曲、舞蹈、戏曲、曲艺等的创作；美术（绘画、雕塑）、工艺品、书法、篆刻等的艺术创作；编导、演员的表演、创作活动（含专门从事歌舞厅的演出）；剧务、舞台美工、服装道具、灯光音响等活动；民族艺术创作；其他未列明的文艺创作、表演及辅助活动。不包括：广告艺术创作，列入7311（广告服务）；摄影艺术创作，列入7395（照相洗印服务）；商业用美术设计，列入7333（商业摄影、工艺、绘图服务）；电影院、礼堂，列入7832（电影院）；体育场馆，列入7941（商业体育场馆、职业体育俱乐部、运动场和体育推广公司）；美术馆及绘画、雕塑等艺术馆，列入7991（旅游与展览）；专门为演出场馆、文艺表演、展览等提供票务的活动，列入7399（未列入其他代码的商业服务）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7832', '电影院', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要指电影院售票活动，也出售有限的点心、饮料等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7841', '音像制品出租商店', '出租和租赁服务 ', '居民服务与商业服务', '主要提供面向公众的音像制品出租服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7911', '歌舞厅 ', '休闲娱乐业 ', '住宿、餐饮与休闲娱乐业', '主要指各类公共舞厅等室内娱乐活动。包括：夜总会、歌舞厅、卡拉OK 厅、练歌房等的活动；电子游艺厅的活动；室内娱乐设施的游戏、游艺活动；以休闲、娱乐为主的动手制作活动（陶艺、缝纫、绘画等）；其他未列明的室内娱乐活动。各种业余舞蹈培训学校、舞蹈工作室，也可归入此类。不包括：台球、保龄球、飞镖等，列入7932（台球、撞球场所），7933（保龄球馆）；健身中心（房），列入7997（会员俱乐部，体育、娱乐、运动等、乡村俱乐部以及私人高尔夫课程班）；电影院、录像厅，列入7832(电影院)；酒吧、咖啡厅，列入5813（饮酒场所，酒吧、酒馆、夜总会、鸡尾酒大厅、迪斯科舞厅）；网吧，列入4816（计算机及信息接入服务）；各类体育设施、游泳馆等列入相应代码。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7922', '戏剧制片（不含电影）、演出和票务 ', '休闲娱乐业 ', '住宿、餐饮与休闲娱乐业', '主要提供各类舞台演出服务，例如露天演出、室内舞台演出的布景、灯光等服务，也提供相关服务，例如挑选演员、订票、布景、灯光和提供其它设备。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7929', '未列入其他代码的乐队、文艺表演 ', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要提供除了在剧院上映的其它娱乐节目，包括音乐家、乐队、管弦乐队、喜剧演员、魔术师以及专门提供婚庆等音乐演奏的商户（实况演奏的乐队或者DJ等）；以及美术（绘画、雕塑）、工艺品、书法、篆刻等的艺术创作；民族艺术创作；其他未列明的文艺创作、表演及辅助活动。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7932', '台球、撞球场所', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要提供投币撞球活动和按小时付租金的撞球活动的商户。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7933', '保龄球馆', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要指保龄球休闲中心。在保龄球中心营业的其他商户，如餐馆、酒吧、保龄球相关商店，必须签订单独的收单协议，使用标明各自业务类型的MCC。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7941', '商业体育场馆、职业体育俱乐部、运动场和体育推广公司', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要指发起并组织职业性或者半职业性的运动俱乐部（例如足球、棒球、手球、曲棍球等）的商户，也经营竞技场馆，发起业余或者职业性的体育竞技，也对运动员进行管理。包括：综合体育场；综合体育馆；体育训练基地；游泳场馆；滑冰场馆；篮、排、足球场馆；网球、羽毛球、乒乓球场馆；棋牌馆；其他未列明的体育场馆等。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7991', '旅游与展览', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要提供各类观光游览胜地、公园，以及各种会议和展览服务。包括：公园门票销售、各类工业品展览会、专业技术展览会、贸易展览、各种商业博览会、博物馆等。也包括近现代重要史迹、纪念性的建筑物的旅游参观活动（含革命遗址、纪念碑、名人故居、宗教寺庙、民间民俗活动等）。不包括：画廊等的艺术作品展示，应列入5971（艺术商和画廊）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7992', '公共高尔夫球场', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要指公共高尔夫球场经营商，提供高尔夫球具推车、设备出租等。球场内的餐馆、咖啡厅等商户，应列入5812（就餐场所和餐馆）和5813（饮酒场所，酒吧、酒馆、夜总会、鸡尾酒大厅、迪斯科舞厅）。高尔夫球具商店，应列入5941（体育用品店）。乡村俱乐部、私人高尔夫俱乐部等，应列入7997（会员俱乐部，体育、娱乐、运动等、乡村俱乐部以及私人高尔夫课程班）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7993', '电子游戏供给', '文化、体育用品及器材专门零售', '零售业 ', '主要经营投币电子游戏机销售的商户。电子游戏娱乐场所应列入 7994（大型游戏机和游戏场所）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7994', '大型游戏机和游戏场所', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要经营电子游戏娱乐活动的场所。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7995', '彩票销售', '休闲娱乐业 ', '住宿、餐饮与休闲娱乐业', '主要指各种形式的彩票活动，如体育、足球、福利等彩票中心的彩票销售活动，以及销售网点。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7996', '游乐园、马戏团、嘉年华、占卜', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要指配有娱乐设施的大型室外娱乐活动及以娱乐为主的活动，提供零食、小吃、游戏、动物展览等。包括：大型游乐园活动；充气娱乐设施的各项活动；水上游乐园活动；其他未列明的游乐园活动。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7997', '会员俱乐部（体育、娱乐、运动等）、乡村俱乐部以及私人高尔夫课程班 ', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要指面向社会开放的休闲健身娱乐场所和综合体育娱乐场所。包括：健身俱乐部、乡村俱乐部、私人高尔夫课程班、划船俱乐部、游泳俱乐部、网球俱乐部、保龄球联合会、马术俱乐部、射击俱乐部、壁球俱乐部以及集游泳、球类、健身为一体的综合性健身中心，惊险娱乐活动场所（跳伞、滑翔、蹦极、攀岩等）等。这些商户也可提供按摩服务。主营此业务的，列入 7297（按摩店）。这些商户也可从事SPA 相关服务，如面部美容、瘦身、芳香疗法、蒸气浴、冲浪浴等。主营此业务的，应列入 7298（保健及美容SPA）。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7998', '水族馆、海洋馆和海豚馆', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要经营动物园或者与海洋动物有关的公园。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('7999', '未列入其他代码的娱乐服务', '休闲娱乐业', '住宿、餐饮与休闲娱乐业', '主要指公园、海滩和旅游景点内小型设施提供的各类娱乐服务，其他群众文化娱乐活动，但无法用其他代码准确描述。包括：公园、景区内的小动物拉车、骑马、钓鱼等活动；租借道具活动（如租借照相、服装、道具等）；海滩浴场更衣及租借用品服务。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '001', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8011', '其他医疗卫生活动', '卫生 ', '教育、卫生与政府服务', '指社区医疗服务机构、门诊部、诊所、医务室、卫生站、村卫生室、护理院等卫生机构的活动。包括：各类门诊部、各单位的门诊部、个体诊所等、其他未列明的门诊医疗服务。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8021', '牙科医生', '卫生', '教育、卫生与政府服务', '指拥有行医执照的专业内科医生服务，或者专业牙医服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8031', '正骨医生', '卫生 ', '教育、卫生与政府服务', '指提供非外科治疗服务的骨骼整形服务。不包括：提供骨骼整形的外科治疗服务的，应列入8011（其他医疗卫生活动）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8041', '按摩医生', '卫生', '教育、卫生与政府服务', '指提供脊椎、四肢等按摩、矫正服务的商户。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8042', '眼科医生', '卫生', '教育、卫生与政府服务', '指拥有行医执照的专业眼科医生服务，包括眼部疾病检查、诊断和治疗服务等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8043', '光学产品、眼镜店', '纺织、服装及日用品专门零售店 ', '零售业', '主要提供眼睛验光、眼科处方、眼镜制作及销售等服务的商户。这类商户可能销售许多光学眼镜相关产品，如，防护眼镜、太阳眼镜、便携式仪器、镜片和隐形眼镜配镜服务等。不包括：与医疗服务难以区分的验光、配镜服务，列入卫生类相关代码。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8049', '手足病医生', '卫生', '教育、卫生与政府服务', '指拥有行医执照的专业眼科医生服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8050', '护理和照料服务', '卫生', '教育、卫生与政府服务', '指提供病人护理和保健相关个人照料服务的商户，包括，康复期护理服务、看护服务、护理福利院和高级长期护理服务。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8062', '公立医院 ', '卫生 ', '教育、卫生与政府服务 ', '指提供医疗诊断服务、各类医疗治疗服务的各类政府公立医院，也包括对病人和患者的护理服务。包括各类综合医院、中医医院、中西医结合医院、民族医院等。各类政府公立专科医院。包括：妇产科、儿科、眼科、骨科、口腔科、传染病、精神病、结核病、肿瘤、外科整形等专科医院各类政府公立医院必须取得相关政府管理部门颁发的组织机构代码证。不包括：宠物医院不得使用此代码，应列入0742（兽医服务）。', ' ', '006', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8071', '医学及牙科实验室 ', '卫生', '教育、卫生与政府服务', '指为专业医生或者他们指定的病人提供的服务，比如生化分析、血液分析、X光、病毒分析，以及诊断分析等。牙科实验室包括假牙、人造牙、以及其他顾客定制整牙设备服务等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8099', '其他医疗保健服务', '卫生', '教育、卫生与政府服务', '各类诊所，如血库、家庭诊所、医药服务中心、运动医疗诊所、整形美容医院、内科及其他专业医生、心理医生和精神病医生等。也包括如计划生育技术服务活动，妇幼保健活动，专科疾病防治活动，防疫活动等预防保健活动。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8111', '法律服务和律师事务所服务', '商业服务', '居民服务与商业服务', '主要提供法律咨询和服务的法律行业成员，比如离婚、破产处理等。包括：与企业事业单位、个人有关的调解、仲裁服务，与海事、对外经济贸易有关的调解、仲裁服务，与专利等知识产权有关的调解、仲裁服务等。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8211', '中小学校（公立）', '教育 ', '教育、卫生与政府服务', '指由政府拨款设立的各类公立中小学校，经本地“事业单位登记管理局”许可，并颁发《事业单位法人证书》。包括，小学、初中、高中的教育活动。不包括：学前班应列入 8351（儿童保育服务，含学前教育）。', ' ', '006', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8220', '普通高校（公立）', '教育 ', '教育、卫生与政府服务', '指经教育行政部门批准、由国家、地方政府设立，获得学历的高等学校，经本地“事业单位登记管理局”许可，并颁发《事业单位法人证书》。指在完成高级中学基础上实施的教育，包括：各类本科院校、专科院校、军事院校和研究生院。', ' ', '006', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8241', '函授学校（成人教育）', '教育', '教育、卫生与政府服务', '指经教育主管部门批准举办的成人高等教育活动。包括：广播电视大学、职工高等学校、农民高等学校、管理干部学校、教育学院、函授学院、普通高校办的函授夜大进修部，以及其他成人高等教育活动。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8244', '商业和文秘学校（中等专业学校）', '教育', '教育、卫生与政府服务', '提供教育行政部门批准，提供一般商业技能培训的学校。比如中等专业学校、职业中学、技工绩效教育等。此类学校可以颁发培训证书，但不提供学位。不包括：职业技能培训，应列入 8249（贸易和职业学校，职业技能培训）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8249', '贸易和职业学校（职业技能培训） ', '教育 ', '教育、卫生与政府服务', '指经教育主管部门、劳动部门或有关主管部门批准，由政府部门、企业、社会办的职业培训、就业培训及各种知识、技能的培训活动。包括：各种职业举办的培训学校的活动，各种就业培训中心的活动，各单位办的培训中心的活动，外语、电脑、汽车驾驶、飞行以及农业技术培训活动，其他技能培训活动（厨师培训、缝纫培训、武术培训等）。不包括：各单位自办的以对外提供住宿为主的培训中心，列入7011（住宿服务－旅馆、酒店、汽车旅馆、度假村等）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8299', '其他学校和教育服务', '教育', '教育、卫生与政府服务', '指各类私立学校，以及上述未列明的教育活动。由各级工商管理部门颁发《企业法人营业执照》的学校或教育机构一般属于私立学校。包括：各类私利中小学、私利高等教育等，中小学课外辅导班（奥林匹克辅导班、各类兴趣班等）的教育活动等。不包括：少年宫、青少年之家、少年活动中心等，列入7999（未列入其他代码的娱乐服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8351', '儿童保育服务（含学前教育）', '教育', '教育、卫生与政府服务', '指对学龄前儿童进行保育和教育的活动。包括：托儿所、幼儿园（全托制、半托制、寄宿制、计时制）、学前班、幼儿活动站、游戏小组、巡回辅导站等幼儿活动。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8398', '慈善和社会公益服务组织 ', '社会组织 ', '教育、卫生与政府服务 ', '民间的募捐组织以及从事社会福利服务（宣传机构、团体组织、卫生机构等）公益组织。包括，为老人、军烈属、五保户、残疾人、弃婴、孤儿、弱智儿童及其他弱势群体提供的看护、帮助等社会福利活动。如，老年活动中心（站）残疾活动中心（站），残疾儿童、弱智儿童托护服务；为贫困群体提供帮助的救助活动，社会公益基金的管理活动（为致残儿童、见义勇为及其他社会公益行为建立的基金），为弱势群体提供帮助的民间机构（志愿者组织等），红十字机构的活动，资助贫困地区和失学儿童的管理与服务活动，社会力量和民间组织提供的贫困救济活动，赈灾、救济管理和服务活动等。慈善、社会公益服务组织应获得当地政府民政主管部门颁发的《社会团体法人登记证书》，或在其提供的《企业法人营业执照》明确其慈善、社会公益性质。', ' ', '006', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8641', '市民、社会及友爱组织', '社会组织', '教育、卫生与政府服务', '指依法成立，在社会团体登记管理机关登记的单位。包括：专业性团体，如作家组织、新闻记者组织、艺术家组织、会计学会、统计学会等；行业性团体，如各类行业协会、联合会、商会、工商会等的活动，企业间的联合组织的活动；其他从事市民、社会或者友爱活动的各种协会，包括校友会、商业社团、会员机构、互助会，社交俱乐部、退伍军人组织以及青年联合会。不包括：红十字会、慈善机构、帮助弱势群体的组织、社会救助组织、社会福利救助性基金会等，列入8398（慈善和社会公益服务组织）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8651', '政治组织（政府机构）', '社会组织', '教育、卫生与政府服务 ', '指宪法规定的国家机构活动和国家武装力量，以及由政治组织或政府正式机构举办的相应管理部门和非经营性质的事业单位。包括：国家行政机关、人民法院和人民检察院、人民政协和民主党派等的活动。不包括：政治组织的下属机构，如研究所、后勤服务中心、计算中心、出版社、印刷厂、协会、研究会、检测中心、福利（体育）彩票中心等经营性事业单位。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8661', '宗教组织', '社会组织', '教育、卫生与政府服务', '寺庙、清真寺、教堂等的宗教活动和经批准的宗教组织的活动。包括：各寺庙、清真寺、教堂的宗教活动。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8675', '汽车协会 ', '商业服务', '居民服务与商业服务', '主要针对汽车协会或者汽车俱乐部。这类商户能够为其会员提供各种各样的特殊服务，诸如出行及路况信息、地图和向导以及餐馆、旅店、汽车租赁机构的特殊优惠。该类商户往往要收取会员年费。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8699', '其他会员组织', '社会组织', '教育、卫生与政府服务 ', '除卫生和运动俱乐部外，上面未提及的会员组织。包括：历史俱乐部、工会、诗歌俱乐部、艺术委员会以及租客联合会。不包括：卫生和运动俱乐部，列入 7997（会员俱乐部，体育、娱乐、运动等、乡村俱乐部以及私人高尔夫课程班）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8911', '建筑、工程和测量服务', '商业服务', '居民服务与商业服务', '主要提供专业建筑、工程测量、土地、水、空间测量，家庭、建筑设计，轮船和机械设计等服务的机构。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8912', '装修、装潢、园艺', '商业服务', '居民服务与商业服务', '主要提供专业装修、装潢设计、咨询和工程管理服务，以及居民园艺规划和保养服务的商户。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8931', '会计、审计、务服务', '商业服务', '居民服务与商业服务', '主要提供会计处理、记账、工资福利发放等服务，及注册会计师审计等相关服务的机构。包括：会计咨询，资产评估、清算，审计咨询及相关活动，税务咨询及相关活动，与财务有关的咨询活动。此类商户可提供所得税咨询服务。主营所得税咨询服务，但不同时不提供会计处理、审计和记账等服务的，应列入 7276（税收准备服务）。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('8999', '未列入其他代码的专业服务', '专业服务', '居民服务与商业服务', '指提供高级专业服务的机构，通常该机构职员需要接收高等专业技能训练才能提供相应的专业服务。这些服务包括，抵押经纪服务、研究服务、财务咨询服务、图表设计服务、审计服务等。注：该商户类别码仅在没有其它明确分类的情况下适用。', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9211', '法庭费用，包括赡养费和子女抚养费 ', '政府服务与公用事业 ', '教育、卫生与政府服务 ', '用于收取法庭管理费或处理费（如案件管理费、诉讼处理费等），赡养费、子女抚养费的支付等。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9222', '罚款 ', '政府服务与公用事业 ', '教育、卫生与政府服务', '用于监管和处理地方相关罚金、罚款、机动车违章以及财产估价罚款等机构。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9223', '保释金 ', '政府服务与公用事业 ', '教育、卫生与政府服务 ', '指提供缴纳保释金服务的机构。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9311', '纳税 ', '政府服务与公用事业 ', '教育、卫生与政府服务 ', '用于从事财政及税收管理的各级政府部门及其它实体，负责税收管理、？及各类罚款的征收、基金的保管与支付，这些机构包括财产税估？办公室、海关及税务委员会。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9399', '未列入其他代码的政府服务（社会保障服务，国家强制）', '政府服务与公用事业 ', '教育、卫生与政府服务 ', '指依据国家有关规定开展的强制性各种社会保障活动（包括各种社会保障的登记，以及社会保障金的收取和发放等活动）。也指政府提供的收养收容服务及其他公益型社会救助活动。包括对老人、残疾人、弃婴、孤儿、弱智儿童、盲流等人员提供住宿的收养、收容活动。如，各类养老院、老年福利院、老年公寓、敬老院，儿童福利院，社会福利院，精神病人福利院，收容遣送站的，流浪儿童救助保护中心等。包括：基本养老保险经办机构，失业保险经办机构，医疗保险经办机构，其他社会保险经办机构。不包括：养老、医疗等商业保险，列入6300（保险销售、保险业和保险金）。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9400', '使领馆收费 ', '政府服务与公用事业 ', '教育、卫生与政府服务 ', '各类使领馆收取的相关费用。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9402', '国家邮政服务', '交通运输、物流和仓储服务', '居民服务与商业服务 ', '主要指国家邮政局系统提供的邮政服务。包括：信函、印刷品邮政服务；包裹的邮政服务；邮品零售服务；邮政寄递服务；邮政编码服务；隶属于国家邮政的特快专递服务；以邮政为主的基层邮电局（所）的服务；其他邮政服务（邮箱出租、邮政礼仪、电子邮政等）。', ' ', '005', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9703', '县乡优惠？宾馆餐饮娱乐类', '临时激励措施（有效期至2011年10月31日', '详情参见《关于采取综合措施促进银行卡在县乡地区使用的通知》（银联业管委[2009]14号）', '详情参见《关于采取综合措施促进银行卡在县乡地区使用的通知》（银联业管委[2009]14号）', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9704', '县乡优惠？房产汽车类', '临时激励措施（有效期至2011年10月31日', '详情参见《关于采取综合措施促进银行卡在县乡地区使用的通知》（银联业管委[2009]14号）', '详情参见《关于采取综合措施促进银行卡在县乡地区使用的通知》（银联业管委[2009]14号）', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9705', '县乡优惠？批发类', '临时激励措施（有效期至2011年10月31日', '详情参见《关于采取综合措施促进银行卡在县乡地区使用的通知》（银联业管委[2009]14号）', '详情参见《关于采取综合措施促进银行卡在县乡地区使用的通知》（银联业管委[2009]14号）', ' ', '003', ' ', '  ');
INSERT INTO `t_cmm_mcc` VALUES ('9706', '县乡优惠？超市加油类', '临时激励措施（有效期至2011年10月31日', '详情参见《关于采取综合措施促进银行卡在县乡地区使用的通知》（银联业管委[2009]14号）', '详情参见《关于采取综合措施促进银行卡在县乡地区使用的通知》（银联业管委[2009]14号）', ' ', '003', ' ', '  ');
